import React from "react";
import Main from './Rout';
import { BrowserRouter,Routes, Route } from "react-router-dom";

export default function Give(){
    return(
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<Main/>} />      
            </Routes>
        </BrowserRouter>
    );
}
